for await ... ofJanuary 19, 2022  js   1 min readvercel/clifor await ofgenerator demo sourcegraphfor await (const n  stars  puppeteer chunkbufferasync function getReadableAsBuffer(
    readable: Readable,
    path?: string
): Promise<Buffer> {
    if (!isNode && path) {
        throw new Error(
            'Cannot write to a path outside of Node.js environment.'
        );
    }

    const fs = isNode ? await importFSModule() : null;

    let fileHandle: import('fs').promises.FileHandle;

    if (path && fs) {
        fileHandle = await fs.promises.open(path, 'w');
    }
    const buffers = [];
    for await (const chunk of readable) {        buffers.push(chunk);
        if (fileHandle) {
            await fs.promises.writeFile(fileHandle, chunk);
        }
    }

    if (path) await fileHandle.close();
    let resultBuffer = null;
    try {
        resultBuffer = Buffer.concat(buffers);
    } finally {
        return resultBuffer;
    }
}
